import { useState } from "react";
import Dashboard from "./components/Dashboard";
import History from "./components/History";

export default function App() {
  const [activeTab, setActiveTab] = useState("dashboard");

  return (
    <div className="min-h-screen bg-gray-100">
      {/* Bara de taburi */}
      <div className="flex justify-center gap-4 py-6 bg-white shadow">
        <button
          onClick={() => setActiveTab("dashboard")}
          className={`px-6 py-2 rounded ${activeTab === "dashboard" ? "bg-blue-600 text-white" : "bg-gray-200 text-gray-700"}`}
        >
          Dashboard
        </button>
        <button
          onClick={() => setActiveTab("history")}
          className={`px-6 py-2 rounded ${activeTab === "history" ? "bg-blue-600 text-white" : "bg-gray-200 text-gray-700"}`}
        >
          Istoric
        </button>
      </div>

      {/* Afișare în funcție de tab-ul selectat */}
      {activeTab === "dashboard" && <Dashboard />}
      {activeTab === "history" && <History />}
    </div>
  );
}
